import * as r from "react";
import t from "../lib/SSRBase.es.js";
import i from "../defs/HardDrive.es.js";
const e = r.forwardRef((o, a) => /* @__PURE__ */ r.createElement(t, { ref: a, ...o, weights: i }));
e.displayName = "HardDriveIcon";
const c = e;
export {
  c as HardDrive,
  e as HardDriveIcon
};
